import React from "react";
import { reduxForm, Field } from "redux-form";

class Signup extends React.Component {
  onSubmit = formProps => {
    console.log(formProps);
  };
  render() {
    return (
      <form>
        <fieldset>
          <label>Email </label>
          <Field
            name="email"
            type="text"
            component="input"
            autoComplete="none"
          />
        </fieldset>
        <fieldset>
          <label>password </label>
          <Field
            name="password"
            type="password"
            component="input"
            autoComplete="none"
          />
        </fieldset>
      </form>
    );
  }
}
export default reduxForm({ form: "signup" })(Signup);
